						<div class="text-1">ABC.</div>

						<div class="text-2">ABCDERFGHIJKLMNOPQRSTUVWXYZ</div>

						<div class="text-3 f-hn_r">
							<p>
								Designed for a wide range of applications, Gentona was intended to support the goals of contemporary design paired with a mostly swiss oriented demand on typography – neutrality. The result is a nine-weight neo-grotesque family ranging from sharp and fine thin cuts to muscle-bound and strong heavy weights. Gentona’s confident and open shapes support legibility especially in small sizes while its alternative shapes and letterforms create flexibility. A wide range of typographic features round up the whole family.<br>
								<br>
								Designers: Rene Bieder<br>
								Design date: 2013
							</p>
